import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


const divStyle = {
  // margin: '0px',
  // border: '5px solid gray',
  backgroundColor: 'gray'
};

const pStyle = {
  fontSize: '36px',
  textAlign: 'left',
  padding: '10px',
  color: 'white'
};

const catDivStyle = {
  border: '5px solid gray'
};

const pCatStyle = {
  fontSize: '36px',
  textAlign: 'left',
  padding: '10px',
  color: 'gray'
};


const Logo = () => (
  <div style={divStyle}>
    <p style={pStyle}>  â†µ   REACT FAMBAM</p>
  </div>
);

const NewTask = () => (
  <div style={divStyle}>
    <p style={pStyle}>+ New Task</p>
  </div>
);

const Section = () => (
  <div name="wrapper">
    <div style={catDivStyle}><p style={pCatStyle}>In Queue</p></div>
    <div style={catDivStyle}><p style={pCatStyle}>In Progress</p></div>
    <div style={catDivStyle}><p style={pCatStyle}>Done</p></div>
  </div>
);

const InQueue = () => (
  <div style={catDivStyle}>
    <p style={pCatStyle}> In Queue </p>
  </div>
);

const InProgress = () => (
  <div style={catDivStyle}>
    <p style={pCatStyle}> In Queue </p>
  </div>
);

const Done = () => (
  <div style={catDivStyle}>
    <p style={pCatStyle}> In Queue </p>
  </div>
);


class App extends Component {
  render() {
    return (
      <div>
        <header>
        <Logo /> <NewTask />
        </header>
        <Section />
      </div>
    );
  }
}



export default App;
